es, así como revocar el consentimiento prestado, mediante solicitud escrita dirigida al responsable del tratamiento al correo electrónico proyectos@irenepascualstudio.es.\\n​\\nPlazo de Conservación\\nLos datos personales proporcionados se conservarán durante el tiempo necesario para cumplir con la finalidad para la que fueron recabados y para determinar las posibles responsabilidades que pudieran derivarse de dicha finalidad, de acuerdo con la normativa aplicable.\\n​\\nSeguridad de los Datos\\nHemos adoptado todas las medidas técnicas y organizativas necesarias para garantizar la seguridad e integridad de tus datos personales, así como para evitar su alteración, pérdida, tratamiento o acceso no autorizado.\\n​\\nCambios en la Política de Privacidad\\nNos reservamos el derecho a modificar o actualizar nuestra política de privacidad en cualquier momento, por lo que te recomendamos revisarla periódicamente para estar informado sobre cómo tratamos y protegemos tus datos personales.\\n​\\nContacto\\nSi tienes alguna pregunta o inquietud sobre nuestra política de privacidad o sobre el tratamiento de tus datos personales, no dudes en ponerte en contacto con nosotros a través de la dirección proyectos@irenepascualstudio.es.\\n"}],"B":[{"A?":"A","A":{"font-size":{"B":"20.8742"},"text-align":{"B":"center"},"color":{"B":"#283d3d"},"font-family":{"B":"YAFdJsnKuGg,0"}}},{"A?":"B","A":23},{"A?":"A","A":{"font-family":{}}},{"A?":"B","A":306},{"A?":"A","A":{"link":{"B":"http://www.estudiovita.com/"}}},{"A?":"B","A":4},{"A?":"A","A":{"link":{}}},{"A?":"B","A":22},{"A?":"A","A":{"font-family":{"B":"YAFdJsnKuGg,0"}}},{"A?":"B","A":2},{"A?":"A","A":{"font-family":{}}},{"A?":"B","A":28},{"A?":"A","A":{"font-family":{"B":"YAFdJsnKuGg,0"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-family":{}}},{"A?":"B","A":136},{"A?":"A","A":{"link":{"B":"mailto:hola@estudiovita.com"}}},{"A?":"B","A":1},{"A?":"A","A":{"link":{}}},{"A?":"B","A":22},{"A?":"A","A":{"font-family":{"B":"YAFdJsnKuGg,0"}}},{"A?"
